package com.res.bean;public class ResUser implements java.io.Serializable {	private static final long serialVersionUID = 1L;		private Integer userId;	private String userName;			public Integer getUserId() {		return userId;	}	public void setUserId(Integer userId) {		this.userId = userId;	}	public String getUserName() {		return userName;	}	public void setUserName(String userName) {		this.userName = userName;	}	}